#graphql

fragment VaultFields on Vault {
  debtToken
  debtSymbol
  collateralToken
  collateralSymbol
  vaultId
  leverageTier
  totalValueLocked
}

query VaultQuery {
  vaults {
    ...VaultFields
  }
}

